    def create_solution(self) -> FloatSolution:
        new_solution = FloatSolution(
            self.lower_bound,
            self.upper_bound,
            self.number_of_objectives,
            self.number_of_constraints)
        new_solution.variables = \
            [random.uniform(self.lower_bound[i]*1.0, self.upper_bound[i]*round((1/self.number_of_variables), 2)) for i in range(self.number_of_variables)]

        return new_solution

    def evaluate(self, solution: FloatSolution) -> FloatSolution:
        obj0 = 0
        obj1 = 0
        if len(solution.variables) == len(self.profit):
            for i in range(len(self.profit)):
                obj0 += solution.variables[i] * self.profit[i][0]
        else:
            print("solution.variables profit len error")
        for i in range(len(self.profit)):
            for j in range(len(self.profit)):
                obj1 += self.covariance_list[i][j] * solution.variables[i] * solution.variables[j]
                # print(covariance_list[i][j], solution.variables[i],solution.variables[j],obj1)
        solution.objectives[0] = obj0 * -1
        solution.objectives[1] = obj1
        # print(solution.objectives[0])
        # print(solution.objectives[1])

        self.__evaluate_constraints(solution)

        return solution

    def __evaluate_constraints(self, solution: FloatSolution) -> None:
        total = sum(solution.variables)
        # print(total)
        solution.constraints[0] = 1 - total
        solution.constraints[1] = total - 0.9


    def get_name(self):
        return 'Psp31'


